import React from 'react';
import { useNavigate } from 'react-router-dom';
import './HomePage.css'; // 스타일 시트를 import 합니다.

function HomePage() {
  let navigate = useNavigate();

  return (
    <div className="home-container">
      <button className="big-button top" onClick={() => navigate('/main')}>
        MAIN
      </button>
      <button className="big-button bottom" onClick={() => navigate('/fl')}>
        FL
      </button>
    </div>
  );
}

export default HomePage;
